import React from 'react';
import styled from 'styled-components';

const PageWrapper = styled.div`

`;

export default function GroceryCards(props) {

    const {grocery} = props;

    return (
       <PageWrapper>
           <p>{grocery.name}</p>
           <p>{grocery.quantity}</p>
       </PageWrapper>
    )
}
